import React from 'react'

const Card = ({name, year, id}) => {
	return (
		<div className ='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
			<img alt='doctors' src={`https://robohash.org/${name}?200x200`} />
			<div>
				<h2>{name}</h2>
				<p>{year}</p>
			</div>
		</div>
		)
}

export default Card;
